【重量※】約６００ｇ<BR>【サイズ※】約 幅１３．７×奥行１９．５×厚さ２．８（ｃｍ） <BR>【主原材料】天然高分子（植物性） <BR>※ １ヶあたりの数値<BR><BR>●表面温度－１６℃！<BR>●保冷能力８倍（一般保冷剤に比べ）<BR>●魚も凍る！ロゴスの強力保冷剤。氷点下パックシリーズ<BR>●通常の保冷剤と併用するだけで長く保冷できます<BR><BR>■使用上のご注意<BR>・ご使用の際は必ず冷凍庫のフリーザーのダイヤルを最強にして、<BR> 氷結体になるまで完全に凍結させてください。<BR> 冷凍庫内がマイナス２０度にならない場合は、凍結しないことがあり<BR> ますのでご注意ください。<BR>・ダイヤルを最強（マイナス２０度以下）にしても凍結しにくい場合<BR> は、冷凍庫の中を空に近い状態にしてから冷凍してください。<BR>・氷結体になるまでの時間は２４時間から４８時間程度ですが、冷凍庫<BR> の機種・性能・条件により、４８時間以上かかる場合もあります。<BR> 氷点下パックを重ねて凍結させると、凍らないことがありますので、<BR> 重ねないでください。<BR>・野菜などの凍らせたくないものと一緒に入れる場合は、氷点下パッ<BR> クを新聞紙などに包み、距離をおいて使用してください。<BR>・耐久性は、使用方法や頻度により異なります。（粘度が薄くなっ<BR> た時が、交換の目安です。）<BR>・内側がアルミ蒸着のソフトクーラーに入れてのご使用はお止めく<BR> ださい。<BR> <BR>※お客さまのPC閲覧環境により、商品写真と実物では多少色具合、<br>
　サイズ感、質感が異なって見える場合もございます。<br>
　ご了承ください。<br><br>

